import {
  withState, withHandlers, pipe, withLifecycle,
} from './util';


const onUpdate = (props) => {
  if (props) { console.log(props.filterData); }
};

const appController = pipe(
  withState(),
  withHandlers({
  }),
  withLifecycle({
    onUpdate,
  }),
);

export default appController;
